#imageframe.bind:
function (d,v,$o) {
				var that = this;
				if (v!=null || d._new) {
					var f = function(d){
						//console.log(d)
						$o.modal({
							manifest:that.Cropper,
							data:{
								data:"",
								filename:"", 
								width:(d.format+"").replace(/\D/g,"")
							},
							width:820,
							global:true,
							screen:true,
							esc:true
						}).then(function (crop) {
							if (Object.isObject(crop) && crop.data) {
								$o.html("");
								$('<img class="cw-preview" src=""/>')
								.attr("src","data:"+(crop.type||"image/jpeg")+";base64,"+crop.data)
								.appendTo($o);
								d.data=crop.data;
								d.format="left"+crop.width;
								crop.data="";
								$o.my().root.my("redraw");
							}
						}).fail(function(a,b){
							console.log("Fail",a,b)
							if (!$o.find("img").size()) {
								$o.my().root.my("remove",true);
							}
						});
					}.fill(d);
					if (d._new) f.delay(250);
					else f();
					if (d._new) delete d._new;
				}
			}

