(function ($o, form) {
	var that = this, 
			d=form.data, 
			$x = $('<div></div>'),
			$src, 
			err=[],
			mode = cw.lib.a2o(d.mode),
			$pane=$('<div class="cw-medium-pane vat dib w200 ml50 fs90 lh120 blue"></div>'),
			keys={},
			$m = $(".cw-app-active #medium"), 
			$e = $(".cw-app-active #meditor"),
			$i = $m.find(">span.cw-item"),
			shtml=[], ocss={}, orepo={};

	this.CSSCompiler($e, ocss)

	$i.each(function(){
		var $f = $(this), 
				data = $f.data(),
				type = $f.my("data").type,
				man = data.my.manifest.Items[type],
				compiler = (man.Compiler || that.Compiler);
		try {
			compiler.call( that, $f, shtml, ocss, orepo, man);
		} catch(e) {
			console.log(e.message, e.stack);
			shtml.push('<p class="red">Error compiling #my-form-'+data.my.cid+' item of type ‘'+type+'’</p>');

			err.push('<p class="red">Error compiling #my-form-'+data.my.cid+' item of type ‘'+type+'’. Message: '+e.message+'</p>');

		}
	});

	$src= $(shtml.join("\n\n\n"));

	$src.appendTo($x);


	if (mode.pane) {
		if ($src.find("h2,h3").each(function(i){
			var $h = $(this),
					style = $h[0].tagName==="H2"?"hoverlink mb7":"hoverlink mb7 fs90 ml10 lh120",
					h = $h.text().toLowerCase()
			.replace(/[^a-z0-9\s]/g,"").compact()
			.replace(/\s/g,"-").to(10);
			if (!h) h="header"+i;
			if (keys[h]) h=h+"-"+Number.random(10,99);
			keys[h]=true;
			h = "CW-"+h;

			$('<div class="'+style+'"><a class="pseudolink" href="#'
				+h+'">'+$h.text()+'</a></div>').appendTo($pane);
			$(this).attr("id",h);
		}).size()) {
			$pane.prepend('<div class="fi-bookmark fs200 mb2 salmon pane-gotop cp" title="On top"></div>');
		};

		// serialize
		$pane = $pane[0].outerHTML;
		$pane+=_txt(that.JS.pane);
	}

	d.html='<style>\n'
	+Object.values(ocss).join("\n")
	+'</style>\n\n'
	+'<div class="w750 dib vat my-manifest-1dn1yeso">'
	+$x.html()
	+'</div>\n'
	+(mode.js?_txt(that.JS.js):'')
	+(mode.pane?'\n\n<!-- Sidepane -->\n\n'+$pane+'\n':'');

	return err;

	function _txt(fn) {
		return '\n\n<s'+'cript>\n$('+cw.lib.jsmin(fn)+');\n<'+'/scri'+'pt>\n';
	}

})

({
	pane: function(){

		$(".cw-medium-pane").css({ 	opacity: "0.05" });

		var highlight,
				locked = false,
				doctitle = document.title;

		$.my.chain(function() {

			highlight = _highlight.debounce(10);

			var h, p,
					curr = "",
					currh2 = "",
					$p = $(".cw-medium-pane"),
					bh = $("body").height(),
					$prev,
					links = {},
					names = {},
					fold = false,
					dirty = true,
					onTop = null,
					top = ($(".my-manifest-1dn1yeso").offset() || {top:75}).top;

			// parse pane for-child-parent rels
			(function() {
				var h2 = "";
				$(".cw-medium-pane a").each(function(i, e) {
					var $h = $(this),
							id = $h.attr("href").from(1);
					if (id) {
						if ($h.parent().is(".fs90")) $(this).parent().addClass(h2).addClass("pane-child");
						else h2 = id;
						links[id] = $(this);
						names[id] = $(this).text();
					}
				});
				if (fold = $p.find(".pane-child").size() > 3) {
					$p.find(".pane-child").slideUp(100);
				}
			})();


			// fix panes
			$(document).on("scroll", highlight);

			$("body").on("click", "#btn-code,#btn-run", function() {
				dirty = true;
			});

			function _highlight() {
				if (locked) return;
				var sc = $(document).scrollTop(),
						sel = "",
						ch,
						diff = 1e100,
						t, lasth2 = "";
				if (sc > top && onTop !== false) {
					$p.css({
						top: "-5px"
					});
					onTop = false;
				} else if (sc <= top && onTop !== true) {
					$p.css({
						top: (top-5)+"px"//"none"
					});
					onTop = true;
					document.title = doctitle;
				}

				if (dirty) {
					// cache top positions of h2, h3
					h = {};
					p = {};
					bh = ch;
					$(".my-manifest-1dn1yeso").find("h2,h3").each(function(i, e) {
						var $h = $(this),
								id;
						if (id = $h.attr("id")) {
							h[id] = $h.offset().top;
							if ($h[0].tagName === "H2") lasth2 = id;
							else p[id] = lasth2;

						}
					});
					dirty = false;
				}

				for (var i in h) {
					t = Math.abs(h[i] - sc);
					if (t < diff) diff = t, sel = i;
				}
				if (sel != curr) {
					curr = sel;
					if ($prev) $prev.removeClass("bg-yellow");
					$prev = links[curr].parent().removeClass("bg-lgray").addClass("bg-yellow");
					if (p[curr]) {
						if (currh2 != p[curr]) {
							currh2 = p[curr];
							$p.find(".bg-lgray").removeClass("bg-lgray");
							$p.find('a[href=#' + currh2 + ']').parent().addClass("bg-lgray");
							if (fold) {
								$p.find(".pane-child:not(." + currh2 + ")").slideUp(100);
								$p.find("." + currh2).slideDown(100);
							}
						}
					} else {
						$p.find(".bg-lgray").removeClass("bg-lgray");
						if (fold) {
							$p.find(".pane-child:not(." + curr + ")").slideUp(100);
							$p.find("." + curr).slideDown(100);
						}
					}
					document.title = names[curr];
				}

			}

			// zoom for images
			$(".cw-preview").css({
				cursor: "pointer"
			}).on("click", function() {
				$.my.modal($(this), null);
			});

			highlight();

			$p.css({
				position:"fixed"
			})
			.animate({
				opacity: "1"
			}, 500);

			$("body").on("click", "a", function() {
				var h = $(this).attr("href");
				if (h.to(1) === "#" && h!="#" && $(h).size()) {
					locked = true;
					$('html, body').animate(
						{
							scrollTop: $(h).offset().top + "px"
						},
						150,
						function() {
							window.location.hash = h;
							locked = false;
							highlight();
						}
					);
					return false;
				}
			});


			$("body").on("click", ".pane-gotop", function(){
				$('html, body').animate(
						{
							scrollTop: "0px"
						},
						70,
						function() {
							window.location.hash = "";
							locked = false;
							highlight();
						}
					);
			});


		}, 10);

	},
	js: function(){
		$.my.modal.parent("#cw-body");
		// zoom for images
		$(".cw-preview").css({cursor:"pointer"}).on("click", function(){
			$.my.modal($(this), null);
		});
		// start chain
		$.my.chain.timeout(500);
		$.my.chain.start();
