		};

		return Tar;



		// - - - - - - - - - - - - - - - - - - - 

		// HEADER

		function _header () {

		/*
		struct posix_header {             // byte offset
			char name[100];               //   0
			char mode[8];                 // 100
			char uid[8];                  // 108
			char gid[8];                  // 116
			char size[12];                // 124
			char mtime[12];               // 136
			char chksum[8];               // 148
			char typeflag;                // 156
