			var utils = _utils(),
				headerFormat;

			headerFormat = [
				{
					'field': 'fileName',
					'length': 100
				},
				{
					'field': 'fileMode',
					'length': 8
				},
				{
					'field': 'uid',
					'length': 8
				},
				{
					'field': 'gid',
					'length': 8
				},
				{
					'field': 'fileSize',
					'length': 12
				},
				{
					'field': 'mtime',
					'length': 12
				},
				{
					'field': 'checksum',
					'length': 8
				},
				{
					'field': 'type',
					'length': 1
				},
				{
					'field': 'linkName',
					'length': 100
				},
				{
					'field': 'ustar',
					'length': 8
				},
				{
					'field': 'owner',
					'length': 32
				},
				{
					'field': 'group',
					'length': 32
				},
