		"#btn-apply": {
			"bind": function (d,v,$o) {
				var f, that = this,
					$r = $o.my().root,
					$c = $r.find("#x1"),
					$img = $r.find("#source"),
					$c2 = $r.find("#x2"),
					n={k:d.scale}, img="",
					width=d.width*1.5;

				if (v!=null && d.cropped) {
					_create (d.crop);

					d.data = $o.my("find","#x1")[0]
						.toDataURL('image/jpeg',0.97)
						.substr(23);
					$o.my().root.trigger("commit");
