	"MakeList": function (data, key){
	var dt, a=[], man, b = data.value;
	for (var i in b) {
		dt = $.type(b[i]);
		man = /^(ob|ar)/.test(dt)?"multi":(dt=="string"&&/^function\s?\([\s\S]+\}$/.test(b[i]))?"function":dt;
		a.push({
			state:1,
			level:data.level+1,
			manifest:"$"+man,
			path:data.path.slice(0).add(data.key),
			type:dt,
			key:i,
			id:i,
			value:b[i]
		})
	}
	return a;
