manifest.init:
function ($o,form) {
	var i, j, that = this, 
			d = form.data.doc,
			items = d.items;

	$o.html(that.HTML);

	// Parser
	if (!window.HTMLParser) that.HTMLParser(window);

	// Busy
	if (!that.app) that.app = {};
	if (!that.app.busy) {
		that.app.busy = function(a){
			$o.toggleClass("cw-app-busy", !!a);
		}
	}

	// prepare doc if it’s empty
	if (!d.items.length) {
		d.items.push( 	$.extend(true, {},that.Item.data, {id:that.GenId()}) );
	}

	// extend runtime
	that.AddItem.Typelist = Object.keys(that.Types).remove("attachment");

	// correct doc
	if (d.s3) that.S3toCouch(d);

	// restore tabs
	if (Object.isArray(d.tabs) && d.tabs.length) {
		var tabs = cw.lib.a2o(d.tabs);
		d.items.forEach(function(elt){
			var p = that.Path(elt);
			if (tabs[p]) tabs[p] = elt;
		});

		d.tabs.forEach(function(i) {
			var t = tabs[i];
			if (Object.isObject(t)) {
				that.Tablist.push(t);
			}
		});
		if (that.Tablist[0]) that.List.push(that.Tablist[0]);
		that.Active = that.List[0].id;
	} 


	// Expanded branches restore

	if (Object.isObject(d.expanded)){
		that.Expanded = $.extend(!0, true, d.expanded);
	}


	// If stiil nothing to open – open first item

	if (!that.List.length) {
		that.Active = d.items[0].id;
		that.List.push(d.items[0]);
		that.Tablist.push(d.items[0]);
	}


	// Dup searcher
	that.getDup = function (item, name0) {
		var i,e, ename, fname = that.Path(item, name0), u=false;
		for (var i=0;i<d.items.length && !u; i++) {
			e = d.items[i];
			ename = that.Path(e);
			if (e.id!==item.id && ename===fname) u = e.type;
		}
		return u;
	};

	//remember mimes
	for (i=0;i<d.items.length;i++) {
		j = d.items[i];
		if (j.type==="attachment" && !j.mime) {
			j.mime = d._attachments[(j.folder?j.folder+"/":"")+j.name+"."+j.ext].content_type;
		}
		if (!j.state) j.state = {savedSdbm:"",sdbm:"",depends:{},impacts:{}};
		delete j.savedSdbm; delete j.depends;
	}

	// delete item event handler

	$o.on("delitem.my", function(evt, item){
		var ipos = d.items.findIndex(_find),
				lpos = that.List.findIndex(_find),
				fname = that.Path(item);
		if (d.items.length>1) {
			d.items.removeAt(ipos);
			that.List.removeAt(lpos);
			that.Tablist.removeAt(that.Tablist.findIndex(_find));
			if (d._attachments && d._attachments[fname.from(1)]) 
				delete d._attachments[fname.from(1)];
			that.Expanded[item.id] = false;

			if (!that.Tablist) that.Tablist.push(d.items[0]);

			if (!that.List.length) that.List.push(that.Tablist[0]);

			that.Active = that.List[0].id;
			$o.find("#items").trigger("recalc");
		}
		else {
			(window.l||cw.lib).note("Can’t remove last resource.","error");
		}

		function _find (e) {
			return e.id == item.id;
		}
	});

		}

manifest.Build:
function (doc0,opts0,$o) {

	var i,j,that = this,
			d = that.data,
			pi = $.Deferred(),
			tdoc = doc0 || that.data.doc,

			opts = $.extend(!0,{ 
				buttons:true, 
				footer:"", 
				checkcreds:false,
				pick:"",
				resolve:true,
				silent:false,
				blocking:true
			},Object.reject(opts0||{},"errors")),

			errors = (opts0||{}).errors || {},
			key,
			items={},
			_process;

	for (i=0;i<tdoc.items.length;i++) {
		if ( !tdoc.items[i].snippet && (j=that.Path(tdoc.items[i])).to(1) != ".") {
			items[j.from(1)] = tdoc.items[i];
		}
	}

	// Make app busy
	if (that.app && that.app.busy) {
		pi.always(function(){ that.app.busy(false); });
		that.app.busy(true);
	}

	// Decode / prepare creds
	var couch = that.GetSettings("couch");

	if (null==couch.docid) {
		if (opts.checkcreds) pi.reject("Can’t decode encrypted doc _id and credentials.");
	}

	_process = _Process.debounce(100);

	try {
		if (opts.resolve) that.ResolveExternals(tdoc, errors).always(_process);
		else _process();

	} catch(e) {
		pi.reject("Error during validation", e.message, e.stack);
	}

	return pi.promise();


	//- - - - - - - - - - - - - - -

	function _Process (){
		var a = that.Items2Atts(tdoc, that.Types, errors, opts.pick?opts.pick:true);

		if (couch.docid) a.result._id = couch.docid;

		if (Object.size(a.err)) {
			// Remove busy shield
			if (that.app && that.app.busy) that.app.busy(false);
			// Ask user what to do
			$o.modal({
				manifest:that.ParseErrors,
				data:$.extend(!0, {}, opts,a ),
				esc:true,
				enter:true,
				screen:opts.blocking?'rgba(255,255,255,0.5)':false,
				align:"top:105%",
				nose:"top",
				bound:10,
				drag:!opts.blocking
			})
			.then(function(){
				_result(a);
			})
			.fail(function(){
				pi.reject("Cancelled");
			});
		} 
		else {
			if (!opts.silent) cw.lib.note("Doc integrity seems to be Ok.");
			_result(a);
		}
	}


	//- - - - - - - - - - - - - - -

	function _result(a){
		if (a.result) {
			var att  = a.result._attachments;

			// Make it last node of the doc
			delete a.result._attachments;
			a.result._attachments = att;

			//console.log(a);

			// load binary atts
			that.db.get(d.doc._id, {
				attachments:true
			})
			.then(
				function(res){
					if (res._attachments) for (var i in res._attachments) {
						if (!a.result._attachments[i] || null == a.result._attachments[i].data) {
							a.result._attachments[i] = {
								content_type:res._attachments[i].content_type,
								data:res._attachments[i].data
							}
						}
						if(items[i]) items[i].state.crc = $.my.f.sdbmCode(res._attachments[i].data);
					};
					pi.resolve(a);
				},
				function(){
					if (!opts.silent) cw.lib.note("Doc is not yet saved, you may need to save doc.", "warning");
					pi.resolve(a);
				}
			);
		}

	} // --end _result

		}

manifest.ResolveExternals:
function (doc0,errs) {
	var that = this, 
			pis,
			async,
			pending = {},
			rows = (doc0 || that.data.doc).items,
			z = $.Deferred(),
			hasErrors = false,
			err = errs || {};

	pis = rows.map(function(e,i){
		var s="", id='', p = e.external, pi; 
		if (p && !/^[x\s]/.test(p)) {
			async = true;
			pi = $.Deferred();

			// Local doc
			if (p.startsWith("pouch://") || p.startsWith("local://")) {
				p = p.from(8).split(/\s+/).compact(true);
				s = p[1]||'';
				id = p[0];

				if (!pending["pouch "+id]) pending["pouch "+id] = that.db.get(id, {attachments:true});

				pending["pouch "+id].then(
					function(doc) {
						if (s) {
							var r = cw.lib.getref(doc, s);
							if (r) {
								pi.resolve(r);
							} else {
								pi.reject("Failed to process local doc '"+id+"', property '"+s+"' not found");
							}
						} else {
							if (doc) pi.resolve(doc);
							else pi.reject("Failed to load local doc '"+id+"'");
						}
					},
					function(){ pi.reject("Failed to load local doc '"+id+"'"); }
				);
			}

			// Local doc, other DB
			else if (p.startsWith("doc://")) {
				p = p.from(6).split(/\s+/).compact(true);

				s = p[1]||'';
				id = p[0];

				var dbid = id.split("/",1)[0];
				id = id.from(dbid.length+1);

				if (cw.db(dbid)) {

					if (!pending["doc "+p[0]]) {
						pending["doc "+p[0]] = cw.db(dbid).get(id, {attachments:true});
					}

					pending["doc "+p[0]].then(
						function(doc) {

							if (!doc) {
								pi.reject("Failed to load PouchDB doc '"+p[0]+"'");
							}

							else if (s) {
								var r = cw.lib.getref(doc, s);
								if (r) pi.resolve(r);
								else pi.reject("Failed to process PouchDB doc '"
															 +p[0]+"', property '"+s+"' not found");
							} else {
								pi.resolve(doc);
							}
						},
						function(){ pi.reject("Failed to load PouchDB doc '"+p[0]+"'"); }
					);
				} else {
					pi.reject("PouchDB DB '"+dbid+' does not exist' );
				}
			}

			// External request
			else if (/^http[s]?:\/\//.test(p)) {
				p = p.split(/\s+/).compact(true);
				s = p[1]||'';
				id = p[0];

				if (!pending["url "+id]) {

					if ('https:'==window.location.protocol && !id.startsWith(window.location.protocol)) {
						pending["url "+id] = $.Deferred().reject('forbidden protocol').promise();
					}
					else 	pending["url "+id] = $.ajax({
							url:id,
							cache:false,
							type:"GET",
							dataType:s?"json":"text",
							xhrFields:{withCredentials:/^https/.test(id)}
						});
				}

				pending["url "+id].then(
					function(doc) {
						var json, r;
						if (s) {
							if (!Object.isObject(doc) && !Object.isArray(doc)) {
								try { doc = JSON.parse(doc) } catch (e) { }
							}
							r = cw.lib.getref(doc, s);
							if (r) {
								pi.resolve(r);
							} else {
								pi.reject("Failed to process external doc '"+id+"', property '"+s+"' not found");
							}
						} else {
							if (doc) pi.resolve(doc);
							else pi.reject("Failed to load external doc '"+id+"'");
						}
					},
					function (msg){ pi.reject("Failed to load external doc '"+id+"'" + (Object.isString(msg)?': '+msg:'')); }
				);
			}

			// Unknown, reject
			else {
				pi.reject("Failed to load resource "+id+', protocol is unknown.');
			}

			return pi.promise();

		} else {
			return e.data;
		}
	});

	if (!async) z.resolve();
	else {
		Q.allSettled(pis)
		.then(
			function(reps){
				reps.forEach(function(e,i){

					var d = rows[i], aname = that.Path(d);

					if (e.state ==="fulfilled") {
						if (Object.isString(e.value)) {
							rows[i].data = e.value;
						}
						else {
							if (Object.isObject(e.value) && rows[i].ext=='js') {

								rows[i].data = cw.lib.js2txt(cw.lib.unjson(e.value),'\t');

							} else {
								rows[i].data = JSON.stringify(e.value,null,'\t');
							}
						}
					}
					else {
						// error
						hasErrors = true;
						_e(aname, e.reason);
					}

				});
				if (!hasErrors) z.resolve();
				else z.reject ("Failed to load external resource(s)","error");
			},
			function(e){
				z.reject ("Failed to load external resource(s)","error");
			}
		)
	}

	return z.promise();


	//- - - - - - - - - - - - - - - - - - - - - - - -

	function _e (iname, error) {
		// Logs error
		if (!err[iname]) err[iname] = [];
		err[iname].push(error);
	}

		}

manifest.Items2Atts:
function (doc0,Types,prevErrors,pick0,depsOnly) {
	var i, j, e, item, 
			that=this,
			doc = doc0 || that.data.doc,
			buildAll = !!pick0,
			pick = Object.isString(pick0)?pick0:"",
			t = Types || that.Types, 
			err = prevErrors || {},

			names = {}, dirty = {},
			aname="", a={}, sn={}, pp={}, tmp = {},
			src = {}, fin = {}, 

			incls = {}, 
			fvalidator = null, 
			isinvalid = null,
			z={};

	// gen empty res obj
	var couch = that.GetSettings("couch");

	if (couch.docid) z._id = couch.docid;
	if (/^_design\//.test(couch.docid)) z.name = doc.name
	z._attachments = {};

