function (doc,$root,opts) {

	var that = this, i, j, url,
			pi = $.Deferred(),
			cdb = that.GetSettings("couch"),
			couch = cdb.dburl.replace(/\/$/,'')+'/',
			creds = (cdb.login && cdb.pwd) ? cdb.login +":" + cdb.pwd :'',
			id = cdb.docid,
			headers = {Accept:"text/plain"},
			obj = opts.result,
			items={},
			exclude = [];

	url = couch+id;
	if (creds) headers.Authorization = "Basic "+ cw.lib.base64(creds);

	for (i=0;i<doc.items.length;i++) {
		if ( !doc.items[i].snippet && (j=that.Path(doc.items[i])).to(1) != ".") {
			items[j.from(1)] = doc.items[i];
		}
	}

	$.ajax({
		url:url,//+'?attachments=true',
		method:"GET",
		cache:false,
		dataType:"json",
		headers:headers
	})
	.then(_combine,_save);


	return pi.promise();

	function _combine(doc0) {
		if (doc0) {
			if (doc0._rev) obj._rev = doc0._rev;

			Object.keys(doc0)
			.forEach(function(i){
				if (i.to(1)!="_" && null==obj[i]) obj[i] = doc0[i];
			});

			var a = doc0._attachments;
			if (Object.size(a)) {
				if (!obj._attachments) obj._attachments={};
				Object.keys(a)
				.forEach(function(i){
					if (null==obj._attachments[i]) {
						// no local att, so keep remote att
						obj._attachments[i] = a[i];
					}
					else if (items[i].state.crc) {
						// have local, check is it eq to remote
						if (
							items[i].state.remote == items[i].state.crc+"-"+a[i].digest
						) {
							// no need to re-save
							obj._attachments[i] = a[i];
							exclude.push(i);
						} 
						else items[i].state.remote="";
					} 
				});
			}
		}

		_save();
	}

	//--------------------

	function _save (doc0) {
		/*var i;
		for (i in obj._attachments) {
			if (obj._attachments[i].data) console.log(i);
		}*/

		return $.ajax({
			url:url,
			method:"PUT",
			dataType:"json",
			headers:headers,
			data:$.my.tojson(obj)
		})
		.then(function(res){
			_load();
		})
		.fail(function(e){
			pi.reject(e);
		});
	}

	//--------------------

	function _load (doc0) {

		return $.ajax({
			url:url,
			method:"GET",
			cache:false,
			dataType:"json",
			headers:headers
		})
		.then(function(res){

			// record md5-s
			Object.keys(res._attachments||{})
			.forEach(function(i){
				if (items[i]) {
					items[i].state.remote = items[i].state.crc +"-" + res._attachments[i].digest;
				}
			});

			pi.resolve();
		})
		.fail(function(e){
			pi.reject(e);
		});
	}

		}

