			key,
			d = that.data;
	// Decode / prepare creds
	if ( cw.crypto && (key = d.doc.creds.crypto)) {
		if (!cw.crypto.has(key)) {
			return {  };
		} else {
			var obj = cw.crypto.dec(d.doc.creds)[section];
			if (obj) {
				return obj;
			} else {
				return {  };
			}
		}
	} else {
		return Object.clone(d.doc[section], !0);
	}
		}

