({

	// Editor

	"#warn":{
		bind: function(d, v, $o){
			var r, that = this;
			if (Object.isFunction(that.validator)){
				try {
					r = that.validator(d);
				} catch (e) {
					r = e.message;
				}
			}
			$o.html(
				r
				?'&nbsp;<span class="'+(that.Err?'pseudolink red':'')+'">'+r+'</span>'
				:""
			);
			$o.toggleClass("hide", !r);
			$o.my("find","#xeditor").toggleClass("b1r", !!r);
		},
		watch:"#editor",
		delay:200
	},

	"#fname":{
		bind: function(d){
			var html="", 
					base = this.GetDoc().export.path, 
					p = !d.snippet && (d.type!="attachment");

			html+= d.folder+(d.folder.length>1?d.folder.to(1):"");
			html+= d.name

			return html;
		}
	},

	"#btn-settings":{
		bind: function(d,v,$o) {
			var that = this, $f;
			if (v!=null) {
				$f = $o;//.my().root;
				if ($f.data("modal")) $f.modal(true);
				else $f.modal({
					manifest: this.Settings,
					data:Object.select(d, 
						"id type desc folder mime size name ext cache parserActive noIncludes snippet external".split(" ").add([/^[A-Z]/])
					),
					done: function(err){
						if (err) {
							cw.lib.note("Fix errors","error");
							return true;
						}
					},
					esc:true,
					enter:true,
					align:"top:0;right:0", 
					screen:"rgba(255,255,255,0.5)",
					css:"fs100"
				}).then(function(res){

					// moveAtt
					var nold = that.RT().Path(d).from(1),
							nnew = that.RT().Path(res).from(1),
							doc = that.RT().data.doc;
					if (nold != nnew && doc._attachments) {
						delete doc._attachments[nold];
					}
					_fin();

					function _fin(){
						$.extend(d, res);
						$o.my("find","#fname").trigger("check");
					}
				});
			}
		},
		watch:"#fname"
	},
